// HelloWorld.tsx
import React from 'react';
import Yollar from '../images/yollar.png'
import Araba from '../images/araba.svg'

const HelloWorld: React.FC = () => {
    return (
        <div>
            <h1>YOL:</h1>
            <img src={Yollar} alt="yol" style={{width:'600px', height:'800px'}}/>
            <img src={Araba} alt="togg" />
        </div>
    );
}

export default HelloWorld;
